import "./M_P.css";
import { Link, useLocation } from "react-router-dom";
import Daum from "./image/daum.jpg";
import Google from "./image/google.png";
import Kakao from "./image/kakao.png";
import Naver from "./image/naver.png";
import character_img from "./character_img.jpg"; // 이미지 불러온 것
import { Component, useState } from "react";
import Axios from "axios";

function Products() {
  const location = useLocation();
  const [intro, set_intro] = useState(location.state.intro);

  const save_intro = () => {
    Axios.post("http://localhost:8000/save_intro", {
      id: location.state.using_id,
      intro: intro,
    })
      .then((res) => {
        alert(location.state.using_id);
        alert("저장했습니다.");
        set_intro(res.data[0].intro);
      })
      .catch((e) => {
        console.error(e);
      });
  };
  const intro_handleChange = (e: any) => {
    set_intro(e.target.value);
  };
  const logout = () => {
    document.location.href = "/";
  };
  return (
    <section className="products">
      <div className="page">
        <div className="side-menu">
          <div className="info">
            <div className="character">
              <img
                src={character_img}
                className="img1"
                alt="character_img.jpg"
              />
            </div>
            <div className="nickname">{location.state.nickname}</div>
            <div className="info-script">
              <div className="introduction">자기소개</div>
              <textarea
                className="introduction-text"
                name="intro"
                value={intro}
                onChange={intro_handleChange}
                placeholder="자기소개를 작성하세요"
              ></textarea>
              <br></br>
              <input type="submit" onClick={save_intro} value="수정"></input>
            </div>
            <div>
              <input type="submit" value="logout" onClick={logout}></input>
            </div>
          </div>
        </div>
      </div>
      <nav className="top-menu">
        <Link
          to={"/main/Info_modify"}
          state={{
            member_id: location.state.member_id,
            member_pass: location.state.member_pass,
            phone: location.state.phone,
            gender: location.state.gender,
            nickname: location.state.nickname,
            SSN: location.state.SSN,
            intro: intro,
          }}
        >
          정보 수정
        </Link>
        <Link
          to={"/main/Schedule"}
          state={{
            member_id: location.state.member_id,
            member_pass: location.state.member_pass,
            phone: location.state.phone,
            gender: location.state.gender,
            nickname: location.state.nickname,
            SSN: location.state.SSN,
            intro: intro,
          }}
        >
          일정
        </Link>
        <Link
          to={"/main/Products"}
          state={{
            member_id: location.state.member_id,
            member_pass: location.state.member_pass,
            phone: location.state.phone,
            gender: location.state.gender,
            nickname: location.state.nickname,
            SSN: location.state.SSN,
            intro: intro,
          }}
        >
          상품
        </Link>
      </nav>
      <tbody>
        <table>
          <td>
            <a href="https://www.daum.net">
              <img src={Daum} className="product_img" alt="daum.jpg"></img>
              <br></br>
              다음
            </a>
          </td>
          <td>
            <a href="https://www.google.com">
              <img src={Google} className="product_img" alt="google.png"></img>
              <br></br>
              구글
            </a>
          </td>
          <td>
            <a href="https://www.kakaocorp.com/page/">
              <img src={Kakao} className="product_img" alt="kakao.png"></img>
              <br></br>
              카카오
            </a>
          </td>
          <td>
            <a href="https://www.naver.com">
              <img src={Naver} className="product_img" alt="naver.png"></img>
              <br></br>
              네이버
            </a>
          </td>
        </table>
      </tbody>
    </section>
  );
}

export default Products;
